import './Icones.css';
import { FaGithub } from "react-icons/fa";
import { FaLinkedin } from "react-icons/fa";
import { GrDocumentPdf } from "react-icons/gr";
import FadeIn from 'react-fade-in';

export default function Icones(){
    return(
        <div className="iconesContato w50">
                <div className="iconeGitHub iconeUnico w33">
                <FadeIn><FaGithub /></FadeIn>
                </div>
                <div className="iconeLinkedIn iconeUnico w33">
                <FadeIn><FaLinkedin prop /></FadeIn>
                </div>
                <div className="iconCurriculum iconeUnico w33">
                <FadeIn><GrDocumentPdf /></FadeIn>
                </div>
    </div>
    );
}
